const Button = ({counter, setCounter}) => {

  return (
    <div>
      {counter.map((item,index)=><div>item}</div>)}
      <button onClick={()=>setCounter(["sadık", "onur", "ali"])}>Arttır</button>
    </div>
  )
}

export default Button
